.github-CacheView {
  width: 100%;
  height: 100%;
  overflow-y: auto;
}
.github-CacheView header {
  text-align: center;
  border-bottom: 1px solid transparent;
  padding: 10px;
}
.github-CacheView-Controls {
  padding: 0 10px;
  text-align: right;
}
.github-CacheView-Clear {
  margin-left: 1em;
}
.github-CacheView-Order select {
  margin-left: 0.5em;
}
.github-CacheView table {
  margin: 10px 20px;
  width: 90%;
}
.github-CacheView thead {
  color: #abb2bf;
  background-color: rgba(255, 255, 255, 0.07);
  font-weight: bold;
}
.github-CacheView td {
  padding: 5px;
  vertical-align: top;
}
.github-CacheView-Key button {
  width: 100%;
  font-family: monospace;
  text-align: left;
}
.github-CacheView-Age {
  min-width: 100px;
}
.github-CacheView-Hits {
  min-width: 50px;
}
.github-CacheView-Content {
  white-space: pre-wrap;
  max-height: 100px;
  overflow-y: scroll;
}
